      public function administradorCampanhaAddAction(Request $request){
        $array = ['error' => ''];
        $funcionarioId = $request->input('funcionario');
        $qtClientes = $request->input('qtClientes');
        
        if($funcionarioId != 'Indefinido'){
            $clientesAtendidos = CampanhaClientes::select('id_cliente')
            ->whereDate('dataCriacao', '<', date("Y-m-d", strtotime(" +2 months")))
            ->get();
    
            $arrayClientesAtendidos = [];
    
            foreach($clientesAtendidos as $item){
            $arrayClientesAtendidos[] = $item['id_cliente'];
            }
    
            $arrayClientesAtendidos = array_unique($arrayClientesAtendidos);
    
            $clientes = Clientes::select('id')->whereNotIn('id', $arrayClientesAtendidos)->limit($qtClientes)->get();
    
            $arrayCampanha = [
              'id_marketing' => $funcionarioId,
              'nome_operador' => session()->get('user')['name'],
              'entregues' => $qtClientes,
              'atendidos' => 0,
              'dataCriacao' => date('Y-m-d'),
              'status' => 0
            ];
            
            $campanha = Campanha::Create($arrayCampanha);
    
            $CampanhaClientes = [];
    
            foreach($clientes as $item){
                $CampanhaClientes[] = [
                    'id_campanha' => $campanha['id'],
                    'id_cliente' =>  $item['id'],
                    'id_marketing' => $funcionarioId,
                    'dataCriacao' => date('Y-m-d'),
                    
                ];
            }
    
            CampanhaClientes::insert($CampanhaClientes);
    
        }else{
            $array['error'] = 'Selecione um funcionário';
            
        }

       

        
      
        return $array;
    }

    
    
