    public function campanhaId(Request $request, $id, $atendimento){
      
      if (!session()->exists('token')) {
          return redirect()->route('login');
      }
      $user = session()->get('user');
      $data = [
          'user' => $user,
          'permissoes' => session()->get('permissoes'),
          'menu_principal' => 'Campanha',
          'menu_secundario' => '-',
          'title' => 'Campanha',
          'campanha_Cliente' => [],
          'campanha_id' => $id,
          'n_atendimento' => $atendimento,
          'quantidade_clientes' => '',
          'campanha_cliente_id' => '',
          'mensagens' => []
          
      ];
      
      $data['campanha_Cliente'] = CampanhaClientes::where('id_campanha', $id)->where('atendido', 0)->get();
      $data['quantidade_clientes'] = count($data['campanha_Cliente']);

      

      if($data['quantidade_clientes'] == 0){
        return redirect('/painel/campanha/');
      }

      if($atendimento <= count($data['campanha_Cliente']) && $atendimento > 0){
        $atendimento--;
        $data['campanha_Cliente']['clientes'] = Clientes::find($data['campanha_Cliente'][$atendimento]['id_cliente']);
        $data['campanha_Cliente']['clientes_beneficio'] = ClientesBeneficio::where('id_cliente', $data['campanha_Cliente'][$atendimento]['id_cliente'])->get();
        $data['campanha_Cliente']['clientes_cartao'] = ClientesCartao::where('id_cliente', $data['campanha_Cliente'][$atendimento]['id_cliente'])->get();
        $data['campanha_Cliente']['clientes_contrato'] = ClientesContrato::where('id_cliente', $data['campanha_Cliente'][$atendimento]['id_cliente'])->get();
        $data['campanha_Cliente']['clientes_endereco'] = ClientesEndereco::where('id_cliente', $data['campanha_Cliente'][$atendimento]['id_cliente'])->get();
        $data['campanha_Cliente']['clientes_senhas'] = ClientesSenhas::where('id_cliente', $data['campanha_Cliente'][$atendimento]['id_cliente'])->get();
        $data['campanha_Cliente']['clientes_telefone'] = ClientesTelefone::where('id_cliente', $data['campanha_Cliente'][$atendimento]['id_cliente'])->get();
        $data['campanha_cliente_id'] = $data['campanha_Cliente'][$atendimento]['id'];
      }else{
        $atendimento--;
        return redirect('/painel/campanha/'.$id.'/atendimento/'.$atendimento);
      }

    

      
      $data['mensagens'] = DB::table('campanha_clientes')
      ->join('users', 'users.id', '=', 'campanha_clientes.id_marketing')
      ->select('campanha_clientes.*', 'users.name as nome_marketing')
      ->where('atendido', 1)
      ->where('id_cliente', $data['campanha_Cliente'][$atendimento]['id_cliente'])
      ->orderBy('id', 'DESC')
      ->get();
      
      
      return view('admin.campanhaId', $data);
    }

    public function finalizaratendimentoAction(Request $request){
        $array = ['error' => ''];
        $situacao = 0;
        if($request->input('botao_press') == '1'){
            $situacao = 1;
        }
        $request->input('id');
        $campanha = CampanhaClientes::find($request->input('id'));
        $campanha->observacao = $request->input('observacao');
        $campanha->atendido = 1;
        $campanha->situacao = $situacao;
        $campanha->duracao = $request->input('time');
        $campanha->save();

        $campanha_pai = Campanha::find($request->input('campanha_pai'));
        $atendidos = $campanha_pai->atendidos;
        $campanha_pai->atendidos = ++$atendidos;
        $campanha_pai->save();
        
      
        return $array;
    }

